import React from 'react';
import styled from "styled-components";

const BoxEach = styled.div`
  border: solid 3px white;
  margin: 15px;
  border-radius: 5px;
  display: inline-block;
  background-color: #6c757d;
  width: 350px;
  height: 380px;
  border: 1px #6c757d;
`;
const BoxText =styled.div`

  border-radius: 5px;

        background-color: transparent;

width: 350px; height: 220px;
color: white;
display: flex;
justify-content: center;
align-items: center;

`;



const Text = styled.p`
  font-size: 15px;
  padding-left: 20px;
  height: 160px;
  text-align: center;
  background-color: #d97b7b;
  display: flex;
justify-content: center;
align-items: center;
border: 2px grey;



`;


const Textbtn =styled.button`
  width  :500px ;
  height: 30px;


`;
const Box = (props) => {
    return (
        <div>
            <BoxEach><BoxText>Thumbnail</BoxText>
                <Text>{props.Text}
                <Textbtn>{props.BtnText1}</Textbtn>
                <Textbtn>{props.BtnText2}</Textbtn>
                
                </Text>
            </BoxEach>
        </div>
    );
};

export default Box;
